from sage.all import *

from Crypto.Util.number import *
from uuid import *


g=25
gapow=[]
D=open('susctf{0bf4a7d7-59f8-35ab-6866-687b470f7f36}','r').readlines()[36:]
for i in range(64):
    line=D[i]
    line=line.split('=')
    gai=int(line[1])
    gapow.append(int(gai))
PR=PolynomialRing(Zmod(q),name='X')
X=PR.gen(0)
line=D[64]
line=line.split('=')
f=PR(eval(line[1]))
line=D[65]
line=line.split('=')
w=int(line[1])
line=D[66]
line=line.split('=')
h=int(line[1])

fdivxw=list(f//(X-w))
fmodxw=f%(X-w)

G=1
for i in range(63):
    G*=pow(int(gapow[i]),int(fdivxw[i]),p)
    G%=p
u=h*inverse(G,p)
AAA=(pow(u,inverse(int(fmodxw),q),p))
print(UUID(int=AAA%(2**128)))